import React from 'react'

import { Box, Button, Figure, Link, Wrapper } from 'blockbuster-design-system'

const _Header = props => {
    const Butt = props.buttonText
        ? (
            <Button
                href={props.buttonLink}
                parentEl={props.linkWrapper}
                secondary
                padding="0.5rem 1rem"
                fontSize="var(--fontSmall)"
                margin="25px 0 25px 25px"
            >
            {props.buttonText}
            </Button>
          )
        : <div></div>;

    return (
        <Box backgroundColor="var(--black)" alignItems="flex-start" justifyContent="space-between">
            <Wrapper>
                <Box backgroundColor="var(--black)" alignItems="center" justifyContent="space-between">
                    <Figure width="250px" objectFit="contain"
                        src="data:image/png;base64,"
                        alt={props.alt}
                    />
                    <Box alignItems="center" backgroundColor="var(--black)" width="auto">
                        {props.children}
                        { Butt }
                    </Box>
                </Box>
            </Wrapper>
        </Box>
    )
}

export default _Header;
